import logo from './logo.svg';
import './App.css';

import { BrowserRouter as Router, RouterProvider, Routes, createBrowserRouter, Route } from 'react-router-dom';

import Home from './Pages/Home.jsx';
import Navbar  from './Navbar/Navbar.jsx';

import AboutMe from './Pages/About-me';


function App() {
  return (
    <div className="App">
      <Router>
        <Route path="/" element={<Home />} />
      </Router>
    </div>
  );
}

export default App;
